import './App.css';
import { ChakraProvider,Box } from '@chakra-ui/react'
import { } from '@chakra-ui/icons'
import Navbar from './components/navBar';
import LeftSideBar from './components/leftSideBar';


function App() {
  return (
     <ChakraProvider >
      <Box bg="#f7f7f8"  color="white" minHeight="100vh">
      <Navbar />
      <LeftSideBar />
     </Box>
      </ChakraProvider>
  );
}

export default App;
